import logo from './logo.svg';
import './App.css';
import Details,{Multipledata} from './propscomponents';

function App() {
  return (
    <div className="App">
      <h>hello</h>
    </div>
  );
}

function New(){
  return(
    <div>
      <h1>New component added.</h1>
      <Details name="infolabz" />
      <Details name="GTU" />
      <Details name="xyz" />
      <Multipledata  name="infolabz" email="info@infolabz.in" />
    </div>
  );
}

export default App;
export {New};
